import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import DriverBall from "../objects/DriverBall";

function Driver(numDrivers) {
  const [drivers, setDrivers] = useState({ x: 0, y: 0 });
  for (let i = 0; i < numDrivers; i++) {
    drivers.push(<DriverBall key={`driverBall-${i}`} />);
  }
  return <div>{drivers}</div>;
  //   return (
